import { h } from "@stencil/core";
import { ApolloProviderConsumer } from "./apollo-client-state";
export function ApolloProvider({ client }, children) {
    return (h("apollo-provider", { client: client }, children));
}
export function ApolloConsumer(_props, children) {
    return (h(ApolloProviderConsumer.Consumer, null, ({ client }) => children[0](client)));
}
